import React, { component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      authUser: null
    };
  }

  render() {
    return (
      <Router>
          <div>
            <Navigation authUser={this.state.authUser} />
          </div>
      </Router>
    );
  }
}

export default App;
